import axios from 'axios';
import Cast from '../utils/cast';

let extensionCover = 'data:image/png;base64,';
let extensionIcon = 'data:image/png;base64,';

const extensionNS = 'Jetta';
const extensionId = `${extensionNS}.feishuWebHook`;

class FeishuWebHookExtension {
  constructor(runtime) {
    this.runtime = runtime;
    this._formatMessage = ((l10n) => {
      Object.keys(l10n).forEach((lang) => {
        let _temp = l10n[lang];
        l10n[lang] = {};
        Object.keys(_temp).forEach((key) => {
          l10n[lang][`${extensionId}.${key}`] = _temp[key];
        });
      });

      return this.runtime.getFormatMessage(l10n);
    })({
      en: {
        Name: 'Feishu WebHook',
        //Message
        'tag.message ': '  Message',
        'block.triggerWebhook':
          'Trigger webhook https://open.feishu.cn/open-apis/bot/v2/hook/ [ID], send text [TEXT] ',
        'block.triggerWebhookWithAtUser':
          'Trigger webhook https://open.feishu.cn/open-apis/bot/v2/hook/ [ID], @[USER_NAME]([USER_ID]) Send text [TEXT] ',
        'block.triggerWebhookWithImage':
          'Trigger webhook https://open.feishu.cn/open-apis/bot/v2/hook/ [ID], send image [IMAGE_KEY] ',
        'block.triggerWebhookWithCard':
          'Trigger webhook https://open.feishu.cn/open-apis/bot/v2/hook/ [ID], send card [CARD_ID] ',
        //Card
        'tag.card': '   Card',
        'block.card.setConfig': 'Set configuration [DATA] for card [ID]',
        'block.card.create': 'Create card [ID] title [TITLE]',
        'block.card.join':
          'Add component type [TYPE] configuration [DATA] to card [ID]',
        'block.card.remove.last': 'Remove the last component of the card [ID]',
        'block.card.remove.all': 'Remove all components of card [ID]',
        //Some L10n
        'defaultValue.text': 'Hello!',
        'resultMessage.emptyValue ': 'Cannot be empty',
      },
      'zh-cn': {
        name: 'WebHook',
        //
        'tag.message': ' ',
        'block.triggerWebhook':
          'webhook https://open.feishu.cn/open-apis/bot/v2/hook/[ID],  [TEXT]',
        'block.triggerWebhookWithAtUser':
          'webhook https://open.feishu.cn/open-apis/bot/v2/hook/[ID], @[USER_NAME]([USER_ID])  [TEXT]',
        'block.triggerWebhookWithImage':
          'webhook https://open.feishu.cn/open-apis/bot/v2/hook/[ID],  [IMAGE_KEY]',
        'block.triggerWebhookWithCard':
          'webhook https://open.feishu.cn/open-apis/bot/v2/hook/[ID],  [CARD_ID]',
        //
        'tag.card': ' ',
        'block.card.setConfig': ' [ID]   [DATA]',
        'block.card.create': ' [ID]  [TITLE]',
        'block.card.join': '  [TYPE]  [DATA]  [ID]',
        'block.card.remove.last': ' [ID] ',
        'block.card.remove.all': ' [ID] ',
        //L10n
        'defaultValue.text': '',
        'resultMessage.emptyValue': '',
      },
    });

    this.app = axios.create();

    // card
    this.customCards = {
      myCard: {
        config: {},
        elements: [
          {
            tag: 'div',
            text: {
              content: '****',
              tag: 'lark_md',
            },
          },
        ],
        header: {
          template: 'blue',
          title: {
            content: '',
            tag: 'plain_text',
          },
        },
      },
    };
  }

  fm(id) {
    id = `${extensionId}.${id}`;
    return this._formatMessage({
      id,
      default: id,
      description: id,
    });
  }

  getHats() {
    return [];
  }

  getInfo() {
    const triggerWebhook = {
      opcode: 'triggerWebhook',
      blockType: 'reporter',
      text: this.fm('block.triggerWebhook'),
      arguments: {
        ID: {
          type: 'string',
          defaultValue: '',
        },
        TEXT: {
          type: 'string',
          defaultValue: this.fm('defaultValue.text'),
        },
      },
    };
    const triggerWebhookWithAtUser = {
      opcode: 'triggerWebhookWithAtUser',
      blockType: 'reporter',
      text: this.fm('block.triggerWebhookWithAtUser'),
      arguments: {
        ID: {
          type: 'string',
          defaultValue: '',
        },
        USER_ID: {
          type: 'string',
          defaultValue: 'all',
        },
        USER_NAME: {
          type: 'string',
          defaultValue: '',
        },
        TEXT: {
          type: 'string',
          defaultValue: this.fm('defaultValue.text'),
        },
      },
    };
    const triggerWebhookWithImage = {
      opcode: 'triggerWebhookWithImage',
      blockType: 'reporter',
      text: this.fm('block.triggerWebhookWithImage'),
      arguments: {
        ID: {
          type: 'string',
          defaultValue: '',
        },
        IMAGE_KEY: {
          type: 'string',
          defaultValue: 'img_v3_025j_16d1594a-f4d1-455f-a339-a1c5cfb24deg',
        },
      },
    };

    const triggerWebhookWithCard = {
      opcode: 'triggerWebhookWithCard',
      blockType: 'reporter',
      text: this.fm('block.triggerWebhookWithCard'),
      arguments: {
        ID: {
          type: 'string',
          defaultValue: '',
        },
        CARD_ID: {
          type: 'string',
          defaultValue: 'myCard',
        },
      },
    };

    const cardCreate = {
      opcode: 'cardCreate',
      blockType: 'command',
      text: this.fm('block.card.create'),
      arguments: {
        ID: {
          type: 'string',
          defaultValue: 'myCard1',
        },
        TITLE: {
          type: 'string',
          defaultValue: '',
        },
      },
    };

    const cardSetConfig = {
      opcode: 'cardSetConfig',
      blockType: 'command',
      text: this.fm('block.card.setConfig'),
      arguments: {
        DATA: {
          type: 'string',
          defaultValue: '{"wide_screen_mode":true}',
        },
        ID: {
          type: 'string',
          defaultValue: 'myCard1',
        },
      },
    };
    const cardJoin = {
      opcode: 'cardJoin',
      blockType: 'command',
      text: this.fm('block.card.join'),
      arguments: {
        TYPE: {
          type: 'string',
          defaultValue: 'markdown',
        },
        DATA: {
          type: 'string',
          defaultValue: '{"content":""}',
        },
        ID: {
          type: 'string',
          defaultValue: 'myCard1',
        },
      },
    };
    const cardRemoveLast = {
      opcode: 'cardRemoveLast',
      blockType: 'command',
      text: this.fm('block.card.remove.last'),
      arguments: {
        ID: {
          type: 'string',
          defaultValue: 'myCard1',
        },
      },
    };

    const cardRemoveAll = {
      opcode: 'cardRemoveAll',
      blockType: 'command',
      text: this.fm('block.card.remove.all'),
      arguments: {
        ID: {
          type: 'string',
          defaultValue: 'myCard1',
        },
      },
    };
    return {
      id: extensionId,
      name: this.fm('name'),
      blockIconURI: extensionIcon,
      menuIconURI: extensionIcon,
      color1: '#8eace1',
      color2: '#86a2d4',
      blocks: [
        '---' + this.fm('tag.message'),
        triggerWebhook,
        triggerWebhookWithAtUser,
        triggerWebhookWithImage,
        triggerWebhookWithCard,
        '---' + this.fm('tag.card'),
        cardCreate,
        cardSetConfig,
        cardJoin,
        cardRemoveLast,
        cardRemoveAll,
      ],
    };
  }

  triggerWebhook({ ID, TEXT }) {
    ID = Cast.toString(ID);
    TEXT = Cast.toString(TEXT);

    if (ID == '' || TEXT == '') {
      return this.fm('resultMessage.emptyValue');
    }

    return this.app
      .post(`https://open.feishu.cn/open-apis/bot/v2/hook/${ID}`, {
        msg_type: 'text',
        content: {
          text: TEXT,
        },
      })
      .then((res) => {
        return JSON.stringify(res.data);
      });
  }

  triggerWebhookWithAtUser({ ID, USER_ID, USER_NAME, TEXT }) {
    ID = Cast.toString(ID);
    USER_ID = Cast.toString(USER_ID);
    USER_NAME = Cast.toString(USER_NAME);
    TEXT = Cast.toString(TEXT);

    if (ID == '' || USER_ID == '' || USER_NAME == '' || TEXT == '') {
      return this.fm('resultMessage.emptyValue');
    }

    return this.app
      .post(`https://open.feishu.cn/open-apis/bot/v2/hook/${ID}`, {
        msg_type: 'text',
        content: {
          text: `<at user_id="${USER_ID}">${
            USER_ID === 'all' ? '' : USER_NAME
          }</at> ${TEXT}`,
        },
      })
      .then((res) => {
        return JSON.stringify(res.data);
      });
  }

  triggerWebhookWithImage({ ID, IMAGE_KEY }) {
    ID = Cast.toString(ID);
    IMAGE_KEY = Cast.toString(IMAGE_KEY);

    if (ID == '' || IMAGE_KEY == '') {
      return this.fm('resultMessage.emptyValue');
    }

    return this.app
      .post(`https://open.feishu.cn/open-apis/bot/v2/hook/${ID}`, {
        msg_type: 'image',
        content: {
          image_key: IMAGE_KEY,
        },
      })
      .then((res) => {
        return JSON.stringify(res.data);
      });
  }

  triggerWebhookWithCard({ ID, CARD_ID }) {
    ID = Cast.toString(ID);
    CARD_ID = Cast.toString(CARD_ID);

    if (ID == '' || CARD_ID == '' || !(CARD_ID in this.customCards)) {
      return this.fm('resultMessage.emptyValue');
    }

    return this.app
      .post(`https://open.feishu.cn/open-apis/bot/v2/hook/${ID}`, {
        msg_type: 'interactive',
        card: this.customCards[CARD_ID],
      })
      .then((res) => {
        return JSON.stringify(res.data);
      });
  }

  cardCreate({ ID, TITLE }) {
    ID = Cast.toString(ID);
    TITLE = Cast.toString(TITLE);

    if (ID == '' || TITLE == '') {
      return this.fm('resultMessage.emptyValue');
    }

    this.customCards[ID] = {
      config: {},
      elements: [],
      header: {
        template: 'blue',
        title: {
          content: TITLE,
          tag: 'plain_text',
        },
      },
    };
  }

  cardSetConfig({ DATA, ID }) {
    DATA = Cast.toString(DATA);
    ID = Cast.toString(ID);

    if (DATA == '' || ID == '' || !(ID in this.customCards)) {
      return this.fm('resultMessage.emptyValue');
    }

    try {
      const data = JSON.parse(DATA) || {};
      this.customCards[ID].config = data;
    } catch (e) {
      return this.fm('resultMessage.emptyValue');
    }
  }

  cardJoin({ TYPE, DATA, ID }) {
    TYPE = Cast.toString(TYPE);
    DATA = Cast.toString(DATA);
    ID = Cast.toString(ID);

    if (TYPE == '' || DATA == '' || ID == '' || !(ID in this.customCards)) {
      return this.fm('resultMessage.emptyValue');
    }

    try {
      const data = JSON.parse(DATA) || {};
      this.customCards[ID].elements.push({
        tag: TYPE,
        ...data,
      });
    } catch (e) {
      return this.fm('resultMessage.emptyValue');
    }
  }

  cardRemoveLast({ ID }) {
    ID = Cast.toString(ID);

    if (ID == '' || !(ID in this.customCards)) {
      return this.fm('resultMessage.emptyValue');
    }

    this.customCards[ID].elements = this.customCards[ID].elements.slice(0, -1);
  }

  cardRemoveAll({ ID }) {
    ID = Cast.toString(ID);

    if (ID == '' || !(ID in this.customCards)) {
      return this.fm('resultMessage.emptyValue');
    }

    this.customCards[ID].elements = [];
  }
}

export default {
  Extension: FeishuWebHookExtension,
  info: {
    name: 'YUEN.feishuWebHook.extensionName',
    description: 'YUEN.feishuWebHook.description',
    doc: 'YUEN.feishuWebHook.doc',
    extensionId,
    iconURL: extensionCover,
    insetIconURL: extensionIcon,
    featured: true,
    disabled: false,
    collaborator: 'YUEN @ CCW',
    collaboratorURL: 'https://www.ccw.site/student/628979aa804a3a2bc801b097',
    collaboratorList: [
      {
        collaborator: 'YUEN @ CCW',
        collaboratorURL:
          'https://www.ccw.site/student/628979aa804a3a2bc801b097',
      },
    ],
  },
  l10n: {
    'zh-cn': {
      'YUEN.feishuWebHook.extensionName': ' WebHook',
      'YUEN.feishuWebHook.description': ' WebHook',
      'YUEN.feishuWebHook.doc':
        'https://learn.ccw.site/article/7795eb4b-170b-435b-bca3-8b7d4e0c24f8',
    },
    en: {
      'YUEN.feishuWebHook.extensionName': 'Feishu WebHook',
      'YUEN.feishuWebHook.description': ' Enhanced WebHook',
      'YUEN.feishuWebHook.doc':
        'https://learn.ccw.site/article/e895cb95-cc0c-47a0-9bbb-a5aabf82750d',
    },
  },
};
